import React, { Component } from 'react';

export class Home extends Component {
  static displayName = Home.name;

  render () {
    return (
      <div>
        <header className="w3-display-container w3-content" style="max-width:1500px;">
          <img className="w3-image"
               style="transform: scaleX(-1);"
               src="https://images.pexels.com/photos/977962/pexels-photo-977962.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940"
               alt="The Bike" style="min-width:1000px" width="1500" height="800"></img>
        </header>
      </div>
    );
  }
}
